import './App.css';
import Home from './Componnent/Home';
import Test from './Componnent/List_item copy';
import {BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {

  return (
    <Router>
      <Routes>
        <Route path='/' element= {<Home/>}>
        <Route path="/rules" render= {<Test/>}></Route>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
